    @test_int [x^6*(a + b*acsch(c*x)), x, 7, (5*b*sqrt(1 + 1/(c^2*x^2))*x^2)/(112*c^5) - (5*b*sqrt(1 + 1/(c^2*x^2))*x^4)/(168*c^3) + (b*sqrt(1 + 1/(c^2*x^2))*x^6)/(42*c) + (x^7*(a + b*acsch(c*x)))/7 - (5*b*atanh(sqrt(1 + 1/(c^2*x^2))))/(112*c^7)]
