    @test_int [(a + b*acsch(c*x))/x^5, x, 5, (b*c*sqrt(1 + 1/(c^2*x^2)))/(16*x^3) - (3*b*c^3*sqrt(1 + 1/(c^2*x^2)))/(32*x) + (3*b*c^4*acsch(c*x))/32 - (a + b*acsch(c*x))/(4*x^4)]
