    @test_int [(a + b*acsch(c*x))/x^7, x, 6, (b*c*sqrt(1 + 1/(c^2*x^2)))/(36*x^5) - (5*b*c^3*sqrt(1 + 1/(c^2*x^2)))/(144*x^3) + (5*b*c^5*sqrt(1 + 1/(c^2*x^2)))/(96*x) - (5*b*c^6*acsch(c*x))/96 - (a + b*acsch(c*x))/(6*x^6)]


    @test_int [x^3*(a + b*acsch(c*x))^2, x, 5, (b^2*x^2)/(12*c^2) - (b*sqrt(1 + 1/(c^2*x^2))*x*(a + b*acsch(c*x)))/(3*c^3) + (b*sqrt(1 + 1/(c^2*x^2))*x^3*(a + b*acsch(c*x)))/(6*c) + (x^4*(a + b*acsch(c*x))^2)/4 - (b^2*log(x))/(3*c^4)]
