    @test_int [x^1*(a + b*acsch(c*x))^2, x, 4, (b*sqrt(1 + 1/(c^2*x^2))*x*(a + b*acsch(c*x)))/c + (x^2*(a + b*acsch(c*x))^2)/2 + (b^2*log(x))/c^2]
