    @test_int [(a + b*acsch(c*x))^2/x^3, x, 4, -b^2/(4*x^2) - (a*b*c^2*acsch(c*x))/2 - (b^2*c^2*acsch(c*x)^2)/4 + (b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x)))/(2*x) - (a + b*acsch(c*x))^2/(2*x^2)]
    @test_int [(a + b*acsch(c*x))^2/x^4, x, 5, (-2*b^2)/(27*x^3) + (4*b^2*c^2)/(9*x) - (4*b*c^3*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x)))/9 + (2*b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x)))/(9*x^2) - (a + b*acsch(c*x))^2/(3*x^3)]
    @test_int [(a + b*acsch(c*x))^2/x^5, x, 5, -b^2/(32*x^4) + (3*b^2*c^2)/(32*x^2) + (3*a*b*c^4*acsch(c*x))/16 + (3*b^2*c^4*acsch(c*x)^2)/32 + (b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x)))/(8*x^3) - (3*b*c^3*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x)))/(16*x) - (a + b*acsch(c*x))^2/(4*x^4)]


    @test_int [x^3*(a + b*acsch(c*x))^3, x, 10, (b^3*sqrt(1 + 1/(c^2*x^2))*x)/(4*c^3) + (b^2*x^2*(a + b*acsch(c*x)))/(4*c^2) - (b*(a + b*acsch(c*x))^2)/(2*c^4) - (b*sqrt(1 + 1/(c^2*x^2))*x*(a + b*acsch(c*x))^2)/(2*c^3) + (b*sqrt(1 + 1/(c^2*x^2))*x^3*(a + b*acsch(c*x))^2)/(4*c) + (x^4*(a + b*acsch(c*x))^3)/4 + (b^2*(a + b*acsch(c*x))*log(1 - ℯ^(2*acsch(c*x))))/c^4 + (b^3*PolyLog(2, ℯ^(2*acsch(c*x))))/(2*c^4)]
    @test_int [x^2*(a + b*acsch(c*x))^3, x, 11, (b^2*x*(a + b*acsch(c*x)))/c^2 + (b*sqrt(1 + 1/(c^2*x^2))*x^2*(a + b*acsch(c*x))^2)/(2*c) + (x^3*(a + b*acsch(c*x))^3)/3 - (b*(a + b*acsch(c*x))^2*atanh(ℯ^acsch(c*x)))/c^3 + (b^3*atanh(sqrt(1 + 1/(c^2*x^2))))/c^3 - (b^2*(a + b*acsch(c*x))*PolyLog(2, -ℯ^acsch(c*x)))/c^3 + (b^2*(a + b*acsch(c*x))*PolyLog(2, ℯ^acsch(c*x)))/c^3 + (b^3*PolyLog(3, -ℯ^acsch(c*x)))/c^3 - (b^3*PolyLog(3, ℯ^acsch(c*x)))/c^3]
    @test_int [x^1*(a + b*acsch(c*x))^3, x, 7, (3*b*(a + b*acsch(c*x))^2)/(2*c^2) + (3*b*sqrt(1 + 1/(c^2*x^2))*x*(a + b*acsch(c*x))^2)/(2*c) + (x^2*(a + b*acsch(c*x))^3)/2 - (3*b^2*(a + b*acsch(c*x))*log(1 - ℯ^(2*acsch(c*x))))/c^2 - (3*b^3*PolyLog(2, ℯ^(2*acsch(c*x))))/(2*c^2)]
    @test_int [x^0*(a + b*acsch(c*x))^3, x, 9, x*(a + b*acsch(c*x))^3 + (6*b*(a + b*acsch(c*x))^2*atanh(ℯ^acsch(c*x)))/c + (6*b^2*(a + b*acsch(c*x))*PolyLog(2, -ℯ^acsch(c*x)))/c - (6*b^2*(a + b*acsch(c*x))*PolyLog(2, ℯ^acsch(c*x)))/c - (6*b^3*PolyLog(3, -ℯ^acsch(c*x)))/c + (6*b^3*PolyLog(3, ℯ^acsch(c*x)))/c]
    @test_int [(a + b*acsch(c*x))^3/x^1, x, 7, (a + b*acsch(c*x))^4/(4*b) - (a + b*acsch(c*x))^3*log(1 - ℯ^(2*acsch(c*x))) - (3*b*(a + b*acsch(c*x))^2*PolyLog(2, ℯ^(2*acsch(c*x))))/2 + (3*b^2*(a + b*acsch(c*x))*PolyLog(3, ℯ^(2*acsch(c*x))))/2 - (3*b^3*PolyLog(4, ℯ^(2*acsch(c*x))))/4]
    @test_int [(a + b*acsch(c*x))^3/x^2, x, 5, 6*b^3*c*sqrt(1 + 1/(c^2*x^2)) - (6*b^2*(a + b*acsch(c*x)))/x + 3*b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2 - (a + b*acsch(c*x))^3/x]
    @test_int [(a + b*acsch(c*x))^3/x^3, x, 6, (3*b^3*c*sqrt(1 + 1/(c^2*x^2)))/(8*x) - (3*b^3*c^2*acsch(c*x))/8 - (3*b^2*(a + b*acsch(c*x)))/(4*x^2) + (3*b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2)/(4*x) - (c^2*(a + b*acsch(c*x))^3)/4 - (a + b*acsch(c*x))^3/(2*x^2)]
    @test_int [(a + b*acsch(c*x))^3/x^4, x, 8, (-14*b^3*c^3*sqrt(1 + 1/(c^2*x^2)))/9 + (2*b^3*c^3*(1 + 1/(c^2*x^2))^(3/2))/27 - (2*b^2*(a + b*acsch(c*x)))/(9*x^3) + (4*b^2*c^2*(a + b*acsch(c*x)))/(3*x) - (2*b*c^3*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2)/3 + (b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2)/(3*x^2) - (a + b*acsch(c*x))^3/(3*x^3)]
    @test_int [(a + b*acsch(c*x))^3/x^5, x, 10, (3*b^3*c*sqrt(1 + 1/(c^2*x^2)))/(128*x^3) - (45*b^3*c^3*sqrt(1 + 1/(c^2*x^2)))/(256*x) + (45*b^3*c^4*acsch(c*x))/256 - (3*b^2*(a + b*acsch(c*x)))/(32*x^4) + (9*b^2*c^2*(a + b*acsch(c*x)))/(32*x^2) + (3*b*c*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2)/(16*x^3) - (9*b*c^3*sqrt(1 + 1/(c^2*x^2))*(a + b*acsch(c*x))^2)/(32*x) + (3*c^4*(a + b*acsch(c*x))^3)/32 - (a + b*acsch(c*x))^3/(4*x^4)]


