    @test_int [x^1/(a + b*acsch(c*x)), x, 0, Unintegrable(x/(a + b*acsch(c*x)), x)]
    @test_int [x^0/(a + b*acsch(c*x)), x, 0, Unintegrable(1/(a + b*acsch(c*x)), x)]
