    @test_int [1/(x^4*(a + b*acsch(c*x))), x, 9, (c^3*cosh(a/b)*CoshIntegral(a/b + acsch(c*x)))/(4*b) - (c^3*cosh((3*a)/b)*CoshIntegral((3*a)/b + 3*acsch(c*x)))/(4*b) - (c^3*sinh(a/b)*SinhIntegral(a/b + acsch(c*x)))/(4*b) + (c^3*sinh((3*a)/b)*SinhIntegral((3*a)/b + 3*acsch(c*x)))/(4*b)]


