    @test_int [(d + e*x)^2*(a + b*acsch(c*x)), x, 10, (b*d*e*sqrt(1 + 1/(c^2*x^2))*x)/c + (b*e^2*sqrt(1 + 1/(c^2*x^2))*x^2)/(6*c) - (b*d^3*acsch(c*x))/(3*e) + ((d + e*x)^3*(a + b*acsch(c*x)))/(3*e) + (b*(6*c^2*d^2 - e^2)*atanh(sqrt(1 + 1/(c^2*x^2))))/(6*c^3)]
    @test_int [(d + e*x)*(a + b*acsch(c*x)), x, 9, (b*e*sqrt(1 + 1/(c^2*x^2))*x)/(2*c) - (b*d^2*acsch(c*x))/(2*e) + ((d + e*x)^2*(a + b*acsch(c*x)))/(2*e) + (b*d*atanh(sqrt(1 + 1/(c^2*x^2))))/c]
